import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';

class Faq extends Component {
  render () {
    return (
      <div>
      <div className='navbar2'>
      <NavLink to="/faq" className="navButton"> FAQ </NavLink>
      </div>
      </div>
    )
  }
}

export default Faq
